int strncmpi(char *ps1, char *ps2, int n)
{
    char *px1, *px2;
    int indicator, i = 0;
    px1 = ps1;
    px2 = ps2;
    indicator = 9999;
    while (indicator == 9999)
    {
        if (++i > n)
            indicator = 0;
        else
        {
            if (*px1 == '\0')
            {
                if (*px2 == '\0')
                    indicator = 0;
                else
                    indicator = -1;
            }
            else
            {
                if (toupper((int)*px1) < toupper((int)*px2))
                    indicator = -1;
                else
                {
                    if (toupper((int)*px1) > toupper((int)*px2))
                        indicator = 1;
                    else
                    {
                        px1 += 1;
                        px2 += 1;
                    }
                }
            }
        }
    }
    return indicator;
}

char* GetItemNameWA(u16 item)
{
    char itemid[10];
    char* line = malloc(100);
    snprintf(itemid, 8, "0x%04X", item);

    rewind(g_Items_WA);
    while (fgets(line, 100, g_Items_WA) != NULL) /* read each line */
    {
        if (strncmpi(itemid, line, 6) == 0) /* If itemID in txt is same as our ID */
        {
            return line+8; //+8 so the itemID and spaces before actual name aren't included
        }
    }

    return "???\n";
}

int main(int argc, char* argv[])
{
    g_Items_WA = fopen("Items_WA.txt", "r");

    u16 id = 0;

    printf(" Item ID  |  Item Name\n\n");
    for (id = 0; id < 0x11AD; id++) {
       
       u16 waid = g_ValidSpotpassGiftItems[id];
       char* itemname = GetItemNameWA(waid);
       printf("  %04X    |   %s", 0x2000+id, itemname);
    }    

    fclose(g_Items_WA);

    return 0;
}
